        super(props)
        this.state = {
            clicked:"doktorzy"
        }
    }


    componentDidMount(){
        DoctorService.getDoctors().then((response)=>{
            this.setState({doctors: response.data})
        });
    }
    render(){
        var ren;
        if(this.state.clicked==="doktorzy"){
        ren = <DoctorComponent />;
    }
    if(this.state.clicked==="login"){
        ren = <LoginComponent />;
    }
